sys_variable_value.value:
(function execute(inputs, outputs) {
    var res = JSON.parse(inputs.response);
    if (inputs.status_code == 200) {
        outputs.status = "Success";
        outputs.name = res.name;
        outputs.merged = res.merged;
        outputs.protected = res.protected;
        outputs.default = res.default;
        outputs.developers_can_push = res.developers_can_push;
        outputs.developers_can_merge = res.developers_can_merge;
        outputs.commit = res.commit;
    } else {
        outputs.status = "Error";
        outputs = new GitlabErrorHandler().commonErrorHandler(inputs, outputs, res);
    }
})(inputs, outputs);

